import React from 'react'

export default function MenuCard(props) {
    console.log(props)
    return (
        <div>
            <h1>{props.menuName}</h1>
            <p>{props.menuDesc}</p>
            <img src={props.menuPhoto}/>
            <p>Cost: ${props.menuPrice}</p>
            <p>Customer Rating: {props.costumerR}</p>
        </div>
    )
}
